import {
    IonButton, IonContent,
} from "@ionic/react";
import { IonRouterOutlet } from "@ionic/react";
import { Route, Redirect } from "react-router-dom";
import Course from '../admin/quiz/Course';
const ViewCourseRoute: React.FC = () => {
    return (
        <IonContent>
            <IonRouterOutlet>

                <Route exact path="/dashboard/mycourse/:id/topic" component={Course} />
                <Route exact path="/dashboard/mycourse/:id/quiz" component={Course} />
                <Route exact path="/dashboard/mycourse/:id/level" component={Course} />


            </IonRouterOutlet>
        </IonContent>

    );
};

export default ViewCourseRoute;
